import React from "react";
import reactDom from "react-dom";
import {add,sub,mult,divis} from "./Heading";

reactDom.render(
<>
<h1>The addition is :-{add(5,200)}</h1>
<h1>The Subtraction is :-{sub(50,20)}</h1>
<h1>The Multiplication is :-{add(5,200)}</h1>
<h1>The Divison is :-{divis(500,20)}</h1>
</>,
document.getElementById("root")
)
